import React from 'react';
import {
  FileUploadDropzone,
  FileUploadList,
  FileUploadRoot,
} from '../Components/FileButton/'; // Adjust the import path as necessary

const HomePage = () => {
  return (
    <FileUploadRoot maxW="xl" alignItems="stretch" maxFiles={10}>
      <FileUploadDropzone
        label="Drag and drop here to upload"
        description=".png, .jpg up to 5MB"
      />
      <FileUploadList />
      <h1>Welcome to MedVisor</h1>
    </FileUploadRoot>
  );
};

export default HomePage;
